function EmployeeInfo() {



  useEffect(() => {
    getAllEmployee({ code: null, name: null })
      .then((res) => {
      console.log(res.data.data);
      return res.data.data;
    });
  }, []);

  return (
    <div className="">
      {/* {" "} */}
      <EmployeeDialog />
    </div>
  );
}

export default EmployeeInfo;
